import {NavDropDown, Nav, Container, Navbar} from 'react-bootstrap';
import { useEffect } from 'react';
import puppy from '../img/puppy.png';
import  '../css/ComponentOne.css';


const One =()=> {
    useEffect (()=>{
        document.getElementById('puppy').style.backgroundImage = `url(${puppy})`;
    });
    return(
        <Container>
            <div id='puppy' style={{height: '728px', width: '698px', backgroundRepeat: 'no-repeat', backgroundSize: 'cover'}}>
            
            </div>
        </Container>
    );
}
export default One;
